<!DOCTYPE html>
<html>
<head lang="en">
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width , initial-scale=1" >
    <link rel="stylesheet" href="css/bootstrap.css"/>
    <link rel="stylesheet" href="css/font-awesome.min.css"/>
    <title>李小虎-web前端</title>
    <style>
        *{
            outline: 0;
            margin: 0;
            padding: 0;
        }
        ul,ol{
            list-style: none;
        }
        a{
            text-decoration: none;
        }
        body{
            font-family: "Microsoft YaHei";
        }
        #header{
            position: relative;
            min-height: 634px;
            width: 100%;
            background: url("imgs/bannerbg.png") no-repeat;
            background-size: cover;
            color: #fff;
        }
        /*****introduce start******/
        #intro{
            position: absolute;
            left: 5%;
            top: 15%;
            width: 40%;
            min-width: 205px;
            padding: 20px;
            background: rgba(0,0,0,.4);
        }
        #intro h1{
            margin: 0 0 20px 0;
        }
        #intro i{
            font-size: 20px;
        }
        #header .photo{
            position: absolute;
            left: 5%;
            top: 15%;
            width: 240px;
            height: 240px;
            border-radius: 50%;
            opacity: 0;
            background: url('imgs/photo.jpg') no-repeat -40px 0;
        }
        /*****introduce end******/
        /*****nav start******/
        #nav{
            position: fixed;
            z-index: 1000;
            right: 3%;
            top: 30%;
        }
        #nav ul{
            display: inline-block;
            margin: 0 auto;
        }
        #nav li{
            display: block;
            line-height: 150%;
            border-radius: 50%;
            background: rgba(0,0,0,.4);
            margin-top: 50px;
        }
        #nav li a{
            color: #fff;
            font-size: 20px;
        }
        #nav li a:hover{
            text-decoration: none;
            color: orange;

        }
        /*****nav end******/
        /*****top start******/
        #top{
            position: fixed;
            right: 3%;
            bottom: 3%;
            border-radius: 50%;
            background: orange;
            transform: rotate(-90deg);

        }
        #top:hover{
            cursor: pointer;
        }
        #top i{
            font-size: 50px;
        }
        /*****top end******/
        #edu{
            height: 500px;
        }

        #my-video{
            /* display: none; */
            object-fit: cover !important;
            object-position: center center;
        }
    </style>
</head>
